class PageAccueil extends Component{
    render(){
        return(
            <div>
                <h1 className="titre">C-LAB</h1>

<nav>
  <ul className="titre">
    <li><h1>Etape n°1</h1></li>
    <li>Etape n°2</li>
    <li>Etape n°3</li>
    <p>Bonjour. Souhaitez-vous consulter <a href="PageLogin.js">la page 2</a> ?</p>
  </ul>
</nav>
            </div>
        )
    }

}

